import styled from "styled-components";

const StyledDiv = styled.div`
  max-width: 420px;
  margin: 0 auto;
`;

let Container = ({ children }) => {
  return (
    <FullHeight>
      <Center>{children}</Center>
    </FullHeight>
  );
};

export default Container;
